(50420, '31EEBFA3-F0AD-4810-ABD8-5E98DBFF56C6', 'Do you love I’m preparing to go out tonight and wanted to share how I am beaming with pride and love and a bit of envy for all the people who were in that audience and that I was not one of them! I’m sure you couldn’t have been more thrilled to be on that stage and sharing the stories of the climbers and more than that….having the climbers get  to share their own  stories. The organization you have built and at community you have willed into existence through intention, planting of seeds and care and love and force of will…it’s awe inspiring.  And you looked absolutely stunning in that dress on that stage no wonder they had you flanked by the men. I’m sure at least 700,000 people in the audience were thinking that woman is not only doing cool shit but she’s smoking hot I really would love to have sex with her. Call and who knows, maybe one of them will be so lucky! Thank you for working with me over the past two weeks to come back from the brink and find loving ways to express our needs and find new and better ways to care for one another and communicate better. I feel that I made some progress for myself which made it Easier to openly share with you my feelings and how you can help me and my younger part trust feel confident. I truly felt it when when you spoke to me the other night and I’ll will share with you again and again how utterly in love with you How grateful I am for us to share this adventure together and sometimes apart. you are my one and only. I adore you. I hope you have a wonderful time tonight and I can’t wait to come back home and have you wear either the orange or the dress you wore today and I will impatiently Take it off so that I can feel your body next to mine while kissing you.', '676347669882582144', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', 'David', '2022-06-07T19:21:09.882582'),
