(50425, 'BD39904D-0871-4543-88F4-91C346CC5334', 'Thank you love for this really heart piercing note. I️ hear your soul in it and it makes me feel so very special. I️‘ve had such a special week and it’s been so great to feel you rooting me on from 3,000 miles away. And thanks for making me feel so sexy too! Your warmth and love are palpable and we are at our best right now. I️’m super proud of how hard we have both worked to make us come back from the brink of moving out for a few days…to this note exuding so much genuine love that we both feel for one another. Thank you for never giving up and for always investing more and more. With everything you have. Hope you had a great night with Ilsa. Snuggles from NOLA now and many more tomorrow.', '676359358314096512', 'None', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', '+19172390518', '2022-06-07T22:35:58.314096'),
